import React, { useEffect, useState, useMemo } from "react";
// import Tenanttable from "./Tenanttable";
import axios from "axios";
import { FetchTenantList } from "./Action";
import { connect } from "react-redux";


const Tenantdata = (props) => {
    useEffect(() => {
        props.loadtenant();
    }, [])

    return (
        // props.tenant.loading?<div><h2>Loading...</h2></div>:
        // props.tenant.errmessage?<div><h2>{props.tenant.errmessage}</h2></div>:
        <div>

            <div className="card">
                <div className="card-header">
                    <h2>Tenants Data</h2>
                </div>
                <div className="card-body">
                    <table className="table table-bordered">
                        <thead className="thead-dark">
                            <tr>
                                <td>Id</td>
                                <td>Tenant</td>
                                <td>Type</td>
                                <td>Admin User</td>
                                <td>Action</td>
                            </tr>
                        </thead>
                        <tbody>
                            <tr>
                                <td>4013</td>
                                <td>https://qatest.qa.local/</td>
                                <td>QA</td>
                                <td>webuiqe@netskope.com</td>
                                <td>
                                    <button type="button" className="btn btn-primary mx-2" data-toggle="modal" data-target="#exampleModal">PDV</button>
                                    <button className="btn btn-primary mx-2">HEALTH</button>
                                    <button className="btn btn-primary mx-2">EVENTGEN</button>
                                </td>

                            </tr>
                            <tr>
                                <td>4004</td>
                                <td>https://apptest.qa.local/</td>
                                <td>QA</td>
                                <td>webuiqe@netskope.com</td>
                                <td>
                                    <button className="btn btn-primary mx-2">PDV</button>
                                    <button className="btn btn-primary mx-2">HEALTH</button>
                                    <button className="btn btn-primary mx-2">EVENTGEN</button>
                                </td>
                            </tr>

                        </tbody>
                    </table>

                </div>
            </div>
        </div>
    );
}

const mapStateToProps = (state) => {
    return {
        tenant: state.tenant
    }
}

const mapDispatchToProps = (dispatch) => {
    return {
        loadtenant: () => dispatch(FetchTenantList())
    }
}


export default connect(mapStateToProps, mapDispatchToProps)(Tenantdata);
